import React, { useEffect, useState } from 'react';
import axios from '../../utils/axios';
import hanoi from '../../image/HaNoi.jpg';
import danang from '../../image/DaNang.jpg';
import hcm from '../../image/HCM.jpg';
import './featured.css';

function Featured({ fetchUrl }) {
  const [cities, setCities] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const request = await axios.get(fetchUrl);
      setCities(request.data);
      return request;
    }
    fetchData();
  }, [fetchUrl]);

  return (
    <div className="featured">
      <div className="featuredItem">
        <img src={hanoi} alt="" className="featuredImg" />
        <div className="featuredTitles">
          <h1>{cities[0].name}</h1>
          <h2>{cities[0].count} properties</h2>
        </div>
      </div>

      <div className="featuredItem">
        <img src={hcm} alt="" className="featuredImg" />
        <div className="featuredTitles">
          <h1>{cities[1].name}</h1>
          <h2>{cities[1].count} properties</h2>
        </div>
      </div>

      <div className="featuredItem">
        <img src={danang} alt="" className="featuredImg" />
        <div className="featuredTitles">
          <h1>{cities[2].name}</h1>
          <h2>{cities[2].count} properties</h2>
        </div>
      </div>
    </div>
  );
}

export default Featured;
